  return (
      <div className="MusicList">
      <h1>Music</h1>
      {MusicList.map((song,i) => {
        return(
            <div key={i} className="song-card">

              <img src={band} width="100%" alt=""/>
              <h4><Link  className="link" to={`music/${song.id}`}>{song.title}</Link></h4>
            </div>
        )
      })}
      </div>
          );
        }

export default Music;
